import React from "react";
import "../styles/item.css";

function Item(props) {
  const item = props.location.state.item;

  return (
    <div className="item-container">
      <h2>{item.title}</h2>
      <p>{item.description}</p>
      <p>${item.price}</p>
    </div>
  );
}

export default Item;
